import React, { useEffect } from 'react';
import { BrowserRouter as Router, Redirect, Route, Switch } from 'react-router-dom';
import { useDispatch } from 'react-redux';
import './App.css';

import Header from './components/Header/Header';
import Home from './components/Home/Home';
import LogIn from './components/Profile/LogIn';
import SignUp from './components/Profile/SignUp';
import ShoppingCart from './components/ShoppingCart/ShoppingCart';
import CheckOut from './components/ShoppingCart/CheckOut';
import Webshop from './components/Webshop/Webshop';
import Footer from './components/Footer/Footer';

import { checkLoginStatus } from './store/Auth.actions';

function App() {
  const dispatch = useDispatch();

  useEffect(() => {
    async function isLoggedIn() {
      await dispatch(checkLoginStatus());
    }
    isLoggedIn();
  }, [dispatch]);

  const PrivateRoute = ({ auth: { isLoggedIn }, children }) => {
    return isLoggedIn ? children : <Navigate to='/login' />;
  };

  return (
    <div className="App">
      <Router>
        <Header />
        <Switch>
          <Route exact path='/' component={Home} />
          <Route path='/login' component={LogIn} />
          <Route path='/signup' coponent={SignUp} />
          <Route path='/webshop/:productGroupId' component={Webshop} />
          <Route exact path='/cart' component={<PrivateRoute><ShoppingCart /></PrivateRoute>} />
          <Route exact path='/checkout' component={<PrivateRoute><CheckOut /></PrivateRoute>} />

          <Redirect from='*' to='/' />
        </Switch>
        <Footer />
      </Router>

    </div>
  );
}

export default App;
